Labyrinth is the classic game where you control a ball by tilting a labyrinth.
Labyrinth is the classic game where you control a steel ball by tilting a wooden labyrinth. The game has over 1000 levels created by the community and you can easily create more levels of your own.

What's in this version: (Updated : Sep 13, 2012)

    New update
        Compatibility with more devices
    Previous update
        Improved stability
        Labyrinth 2 levels

Required Android O/S : 2.1+


